import React from 'react';
import {Link} from 'react-router-dom';
function LandingPage(){
return <div className="text-center mt-10">
<h1 className="text-4xl font-bold mb-4">Welcome to TalentHub</h1>
<Link className="text-blue-600" to="/login">Login</Link> | <Link className="text-green-600" to="/register">Register</Link>
</div>;
}
export default LandingPage;
